    })  

    render() {
        return (
            <tr>
            <td>Mary</td>
            <td>Moe</td>
            <td>mary@example.com</td>
            <td>Hannoi</td>
            <td> 
              <div className="btn btn-success sua"> <i className="fa fa-edit"></i> Edit</div>
              <div className="btn btn-danger xoa">  <i className="fa fa-delete"></i> Delete</div>
            </td>
          </tr>
        );
    }
}

export default TableData;
